__NUXT_JSONP__("/drugs/Anti-PSMACD28_Bispecific_Antibody_REGN5678", (function(a,b,c,d){return {data:[{drug:{slug:b,emaEpar:[],fdaDrugLabel:[],id:b,nciThesaurus:{casRegistry:a,chebiId:a,chemicalFormula:a,definition:"A bispecific antibody directed against both the tumor-associated antigen (TAA) prostate-specific membrane antigen (PSMA) and the co-stimulatory T-cell-specific surface glycoprotein CD28, with potential immunostimulating and antineoplastic activities. Upon administration of anti-PSMA\u002FCD28 bispecific antibody REGN5678, this bispecific antibody binds to both CD28 on cytotoxic T-lymphocytes (CTLs) and PSMA found on PSMA-expressing tumor cells. This activates and redirects CTLs to PSMA-expressing tumor cells, which may result in the CTL-mediated cell death of PSMA-expressing tumor cells. PSMA is overexpressed on the surface of metastatic and hormone-refractory prostate cancer cells.",fdaUniiCode:"M355PGI1TG",identifier:"C162936",preferredName:c,semanticType:"Amino Acid, Peptide, or Protein",subclassOf:["C176017","C28227"],synonyms:["Anti-PSMA\u002FAnti-CD28 Bispecific Antibody REGN5678",c,"Anti-PSMAxCD28 Antibody REGN5678","REGN 5678","REGN-5678","REGN5678"]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FAnti-PSMACD28_Bispecific_Antibody_REGN5678",extension:".json",createdAt:d,updatedAt:d}}],fetch:{},mutations:void 0}}("","Anti-PSMACD28_Bispecific_Antibody_REGN5678","Anti-PSMA\u002FCD28 Bispecific Antibody REGN5678","2021-10-30T13:35:30.893Z")));